// import Dropdown from 'react-bootstrap/Dropdown';
import '../../css/ActionDropdown.css';
import React from 'react';
// import Switch from './Switch';

const ActionDropdown = () => {
  return (
  <div className="dropdown">
    <button id="dropdown-basic" aria-expanded="false" type="button" className="fs-3 dropdown-toggle btn btn-success">
      ...
    </button>
    <div x-placement="bottom-start" className="dropdown-menu dropdown-menu" aria-labelledby="dropdown-basic" data-popper-reference-hidden="false"
      data-popper-escaped="false" data-popper-placement="bottom-start"
      style={{
        position: "fixed",
        inset: "0px auto auto 0px",
        transform: "translate3d(1416px, 87.2px, 0px)"
      }}
    >
      <a data-rr-ui-dropdown-item="" className="dropdown-item" role="button" tabIndex={0}>
        View
      </a>
      <a data-rr-ui-dropdown-item="" className="dropdown-item" role="button" tabIndex={0}>
        Update
      </a>
      <a data-rr-ui-dropdown-item="" className="dropdown-item" role="button" tabIndex={0}>
        Status
        <form className="">
          <div className="dropdown-item form-switch">
            <input type="checkbox" className="form-check-input" defaultChecked=""/>
          </div>
        </form>
      </a>
      <a data-rr-ui-dropdown-item="" className="dropdown-item" role="button" tabIndex={0}>
        Assign
      </a>
    </div>
  </div>
  );
}

export default ActionDropdown;
